import { formatDatetime } from "@/common/utils/formatting/datetime";
import { IAdapterSpec } from "@/features/adapters/types/IAdapterSpec";
import { IVRisingServerStateInfo } from "@/features/adapters/v-rising/types/IVRisingServerStateInfo";

const V_RISING_RE = {
  serverSaved: /Persistence\w* - Finished Saving/i,
  playerJoined:
    /User '\{Steam .+}' '(.+)', approvedUserIndex: \w+, Character: '(.*)' connected as ID '.*', Entity '.*'/i,
  playerLeft:
    /SteamNetworkin\s+SteamNetConnections.ConnectionUpdate:\s+k_ESteamNetworkingConnectionState_ClosedByPeer,\s+\w+/,
};

export const V_RISING_ADAPTER_SPEC: IAdapterSpec<
  "v-rising",
  IVRisingServerStateInfo
> = {
  id: "v-rising",
  name: "V Rising",
  logo: {
    src: "data:image/png;base64,",
    height: 289,
    width: 800,
    omitTextFromLogoBanner: true,
  },
  configSpecs: {
    "ServerHostSettings.json": {
      type: "json",
      indent: "  ",
      newline: "\r\n",
      newlineEof: false,
    },
    "ServerGameSettings.json": {
      type: "json",
      indent: "  ",
      newline: "\r\n",
      newlineEof: false,
    },
  },
  stateInfoSpec: {
    checkStarted: (data, _current) =>
      /\[Server] Shutting down Asynchronous Streaming/i.test(data),
    infoGetters: [
      (data, _current) => ({
        gameVersion: data.match(/Version: VRisingServer (\S+)/i)?.[1],
      }),
      (data, _current) => ({
        gameId: data.match(
          /SteamPlatformSystem - OnPolicyResponse - Game server SteamID: (\w+)/i,
        )?.[1],
      }),
      (data, _current) => ({
        publicIp: data.match(
          /SteamPlatformSystem - OnPolicyResponse - Public IP: (\d+\.\d+\.\d+\.\d+)/i,
        )?.[1],
      }),
      (data, current) => ({
        lastSaved: V_RISING_RE.serverSaved.test(data)
          ? formatDatetime(new Date(), true)
          : undefined,
        savedCount: V_RISING_RE.serverSaved.test(data)
          ? (current?.savedCount ?? 0) + 1
          : undefined,
      }),
      (data, current) => {
        let currentPlayerCount = current?.playerCount ?? 0;
        let isJoinEvent = false;
        let isLeaveEvent = false;
        if (V_RISING_RE.playerJoined.test(data)) {
          isJoinEvent = true;
          currentPlayerCount++;
        }
        if (V_RISING_RE.playerLeft.test(data)) {
          isLeaveEvent = true;
          currentPlayerCount--;
        }

        return {
          playerCount: currentPlayerCount,
          lastLoggedOn: isJoinEvent
            ? formatDatetime(new Date(), true)
            : undefined,
          lastLoggedOff: isLeaveEvent
            ? formatDatetime(new Date(), true)
            : undefined,
        };
      },
      (data, current) => {
        const chars = new Set(
          current?.characters ? current.characters.split(",") : [],
        );

        const joinedPlayerMatch = data.match(V_RISING_RE.playerJoined);
        if (joinedPlayerMatch) {
          chars.add(`${joinedPlayerMatch[1]}:${joinedPlayerMatch[2]}`);
        }

        const leftPlayer = data.match(V_RISING_RE.playerLeft)?.[1];
        if (leftPlayer) {
          chars.forEach((char) => {
            if (char.startsWith(leftPlayer)) {
              chars.delete(char);
            }
          });
        }

        return {
          characters: chars ? Array.from(chars).join(", ") : undefined,
        };
      },
    ],
  },
};
